                stack.push(new Result(0, 0));
            } else if (c == ')') {
                Result r1 = stack.pop();
                Result r2 = stack.pop();
                int minFlips = Math.min(r1.minFlips + r2.minFlips, 
                                        r1.val == 1 ? r2.minFlips : r1.minFlips);
                if (r1.val != r2.val) {
                    minFlips++;
                }
                stack.push(new Result(r1.val | r2.val, minFlips));
            } else if (c == '&') {
                Result r1 = stack.pop();
                Result r2 = stack.pop();
                int minFlips = Math.min(r1.minFlips + r2.minFlips, 
                                        r1.val == 0 ? r2.minFlips : r1.minFlips);
                if (r1.val != r2.val) {
                    minFlips++;
                }
                stack.push(new Result(r1.val & r2.val, minFlips));
            } else if (c == '|') {
                Result r1 = stack.pop();
                Result r2 = stack.pop();
                int minFlips = Math.min(r1.minFlips + r2.minFlips, 
                                        r1.val == 0 ? r2.minFlips : r1.minFlips);
                if (r1.val != r2.val) {
