public class Solution {
    public int getMinSwaps(String num, int k) {
        char[] chars = num.toCharArray();
        for (int i = 0; i < k; i++) {
            nextPermutation(chars);
        }

        int res = 0;
        char[] origin = num.toCharArray();
        for (int i = 0; i < chars.length; i++) {
            if (chars[i] != origin[i]) {
                int j = i + 1;
                while (j < chars.length && chars[j] != origin[i]) {
                    j++;
                }
                res += j - i;
                swap(chars, i, j);
            }
        }

        return res;
    }

    private void nextPermutation(char[] nums) {
        int n = nums.length;
        int i = n - 2;
        while (i >= 0 && nums[i + 1] <= nums[i]) {
            i--;
        }
        if (i >= 0) {
            int j = n - 1;
            while (nums[j] <= nums[i]) {
                j--;
            }
            swap(nums, i, j);
        }
        reverse(nums, i + 1);
    }

    private void swap(char[] nums, int i, int j) {
        char temp = nums[i];
        nums[i] = nums[j];
        nums[j] = temp;
    }

    private void reverse(char[] nums, int start) {
        int left = start, right = nums.length - 1;
        while (left < right) {
            swap(nums, left++, right--);
        }
    }
}

