import java.util.Arrays;
import java.util.Random;

public class Solution {
    private static final int MOD = (int) 1e9 + 7;
    private static final Random RAND = new Random();

    public int makeStringSorted(String s) {
        char[] chars = s.toCharArray();
        long res = 0, inv = 0;
        for (int i = 0; i < chars.length - 1; ++i) {
            if (chars[i] > chars[i + 1]) {
                res++;
                int j = find(chars, i);
                swap(chars, i, j);
                reverse(chars, i + 1);
                inv += count(chars, i);
                while (inv >= MOD) inv -= MOD;
            }
        }
        return (int) res * (res + 1) / 2 % MOD;
    }

    private int find(char[] chars, int start) {
        for (int j = chars.length - 1; j > start; --j)
            if (chars[j] < chars[start]) return j;
        throw new RuntimeException("Not found");
    }

    private void swap(char[] chars, int i, int j) {
        char temp = chars[i];
        chars[i] = chars[j];
        chars[j] = temp;
    }

    private void reverse(char[] chars, int start) {
        for (int l = start, r = chars.length - 1; l < r; ++l, --r)
            swap(chars, l, r);
    }

    private long count(char[] chars, int end) {
        long res = 0;
        for (int i = 0; i <= end; ++i) {
            if (chars[i] > chars[end + 1]) res++;
        }
        return res;
    }
}

