public class Solution {
    public int minFlips(String s) {
        char[] chars = s.toCharArray();
        int n = chars.length;
        int res = 0, cnt1 = 0, cnt2 = 0;

        // Count the number of flips needed for "10" and "01"
        for (int i = 0; i < n; i++) {
            if ((i % 2 == 0 && chars[i] != '1') || (i % 2 == 1 && chars[i] != '0')) cnt1++;
            if ((i % 2 == 0 && chars[i] != '0') || (i % 2 == 1 && chars[i] != '1')) cnt2++;
        }

        res = Math.min(cnt1, cnt2);

        // Try to rotate the string and update the result
        for (int i = 0; i < n; i++) {
            if ((i % 2 == 0 && chars[i] != '1') || (i % 2 == 1 && chars[i] != '0')) cnt1--;
            if ((i % 2 == 0 && chars[i] != '0') || (i % 2 == 1 && chars[i] != '1')) cnt2--;

            char c = chars[0];
            for (int j = 0; j < n - 1; j++) {
                chars[j] = chars[j + 1];
            }
            chars[n - 1] = c;

            if ((n % 2 == 0 && chars[n - 1] != '1') || (n % 2 == 1 && chars[n - 1] != '0')) cnt1++;
            if ((n % 2 == 0 && chars[n - 1] != '0') || (n % 2 == 1 && chars[n - 1] != '1')) cnt2++;

            res = Math.min(res, Math.min(cnt1, cnt2));
        }

        return res;
    }
}

