public class Solution {
    public int minSwaps(String s) {
        int n = s.length();
        int count0 = 0, count1 = 0;

        // Count the number of '0's and '1's in the string.
        for (char c : s.toCharArray()) {
            if (c == '0') {
                count0++;
            } else {
                count1++;
            }
        }

        // If the difference between the counts is more than 1, it's impossible to make the string alternating.
        if (Math.abs(count0 - count1) > 1) {
            return -1;
        }

        int res = Integer.MAX_VALUE;

        // Try both possibilities: starting with '0' and starting with '1'.
        for (int start = 0; start < 2; start++) {
            int cur = 0, target = start;

            // Count the number of swaps needed to make the string alternating.
            for (char c : s.toCharArray()) {
                if ((c - '0') != target) {
                    cur++;
                }
                target ^= 1;
            }

            res = Math.min(res, cur);
        }

        return res == Integer.MAX_VALUE ? -1 : (res + 1) / 2;
    }
}

