public class Solution {
    public int[] closestRoom(int[][] rooms, int[][] queries) {
        Arrays.sort(rooms, (a, b) -> Integer.compare(b[1], a[1]));

        int k = queries.length;
        int[] ans = new int[k];
        for (int i = 0; i < k; ++i)
            ans[i] = -1;

        TreeSet<Integer> availableRooms = new TreeSet<>();
        int j = 0;
        for (int i = 0; i < k; ++i) {
            int preferred = queries[i][0], minSize = queries[i][1];
            while (j < rooms.length && rooms[j][1] >= minSize) {
                availableRooms.add(rooms[j++][0]);
            }
            Integer lower = availableRooms.floor(preferred);
            Integer higher = availableRooms.ceiling(preferred);
            if ((lower != null && Math.abs(lower - preferred) <= Math.abs(higher == null ? Integer.MAX_VALUE : higher - preferred)) ||
                    (higher == null || Math.abs(higher - preferred) > Math.abs(lower - preferred))) {
                ans[i] = lower;
            } else {
                ans[i] = higher;
            }
        }

        return ans;
    }
}

