public class Solution {
    public int maxHappyGroups(int batchSize, int[] groups) {
        int n = groups.length;
        int[] remainders = new int[n];
        for (int i = 0; i < n; i++) {
            remainders[i] = groups[i] % batchSize;
        }

        Map<Integer, Integer> map = new HashMap<>();
        Arrays.sort(remainders);
        int res = 0;
        int sum = 0;
        for (int remainder : remainders) {
            if (remainder == 0) {
                res++;
            } else {
                sum += remainder;
                if (sum % batchSize == 0) {
                    res++;
                    sum = 0;
                }
            }
        }

        return res + helper(batchSize, map, sum);
    }

    private int helper(int batchSize, Map<Integer, Integer> map, int sum) {
        if (map.containsKey(sum)) {
            return map.get(sum);
        }
        int max = 0;
        for (int i = 1; i < batchSize; i++) {
            int nextSum = (sum + i) % batchSize;
            int cur = helper(batchSize, map, nextSum);
            if ((i + nextSum) % batchSize == 0) {
                cur++;
            }
            max = Math.max(max, cur);
        }
        map.put(sum, max);
        return max;
    }
}

