public class Solution {
    public int maxValue(int n, int index, int maxSum) {
        int left = 0;
        int right = maxSum - n + 1;

        while (left < right) {
            int mid = left + (right - left + 1) / 2;
            if (check(mid, n, index, maxSum)) {
                left = mid;
            } else {
                right = mid - 1;
            }
        }

        return left;
    }

    private boolean check(int x, int n, int index, int maxSum) {
        long sum = x;

        for (int i = 1; i <= Math.min(index, n - index - 1); i++) {
            sum += Math.max(x - i, 1);
        }

        if (index != n - index - 1) {
            sum += Math.max(x - (n - index - 1), 0);
        }

        return sum <= maxSum;
    }
}

