import java.util.Arrays;
public class Solution {
    public int minimumXORSum(int[] nums1, int[] nums2) {
        boolean[][] dp = new boolean[nums1.length + 1][1 << nums2.length];
        dp[0][0] = true;

        for (int i = 0; i < nums1.length; i++) {
            for (int j = 0; j < (1 << nums2.length); j++) {
                if (!dp[i][j]) continue;

                for (int k = 0; k < nums2.length; k++) {
                    if (((j >> k) & 1) == 1) continue;

                    dp[i + 1][j | (1 << k)] |= true;
                }
            }
        }

        int ans = Integer.MAX_VALUE;
        for (int i = 0; i < (1 << nums2.length); i++) {
            if (!dp[nums1.length][i]) continue;

            int sum = 0, tmp = i;
            for (int j = 0; j < nums1.length; j++) {
                sum += (nums1[j] ^ nums2[(tmp & -tmp).getLowestSetBit()]);
                tmp -= (1 << (tmp & -tmp).getLowestSetBit());
            }

            ans = Math.min(ans, sum);
        }

        return ans;
    }
}

