public class Solution {
    public int[] getOrder(int[][] tasks) {
        int n = tasks.length;
        Task[] taskArray = new Task[n];

        for (int i = 0; i < n; i++) {
            taskArray[i] = new Task(tasks[i][0], tasks[i][1], i);
        }

        Arrays.sort(taskArray, Comparator.comparingInt(a -> a.enqueueTime));

        PriorityQueue<Task> pq = new PriorityQueue<>(Comparator.comparingInt(a -> a.processingTime).thenComparingInt(a -> a.index));

        int[] result = new int[n];
        int idx = 0;
        long currentTime = taskArray[0].enqueueTime;

        for (int i = 0; i < n; i++) {
            while (i < n && taskArray[i].enqueueTime <= currentTime) {
                pq.offer(taskArray[i]);
                i++;
            }

            if (!pq.isEmpty()) {
                Task t = pq.poll();
                result[idx++] = t.index;
                currentTime += t.processingTime;
            } else {
                currentTime = taskArray[i].enqueueTime;
                i--;
            }
        }

        return result;
    }

    private static class Task {
        int enqueueTime, processingTime, index;

        public Task(int enqueueTime, int processingTime, int index) {
            this.enqueueTime = enqueueTime;
            this.processingTime = processingTime;
            this.index = index;
        }
    }
