public class Solution {
    public int countPairs(int[] nums, int low, int high) {
        int n = nums.length;
        long res = 0;
        Random rand = new Random();
        Trie root = new Trie();

        for (int i = 0; i < n; ++i) {
            Trie node = root;
            int sum = 0;

            for (int j = 30; j >= 0; --j) {
                boolean curBit = ((nums[i] >> j) & 1) == 1;
                if (!node.children[curBit ? 1 : 0]) {
                    node.children[curBit ? 1 : 0] = new Trie();
                }
                node = node.children[curBit ? 1 : 0];
            }

            int[] cnt = new int[2];

            for (int j = high; j >= low; --j) {
                sum += dfs(node, nums[i], j, cnt);
            }

            res += sum;
        }

        return (int)res;
    }

    private long dfs(Trie node, int x, int limit, int[] cnt) {
        if (!node)
            return 0;

        boolean curBit = ((limit >> cnt[1]) & 1) == 1;
        cnt[1]++;

        if (cnt[1] > 30 || !node.children[curBit ? 1 : 0])
            return dfs(node.children[curBit ? 0 : 1], x, limit, cnt);

        long res = node.cnt + dfs(node.children[curBit ? 1 : 0], x, limit, cnt);
        cnt[1]--;

        if (((x >> (cnt[1])) & 1) == 1)
            return res;

        return res - dfs(node.children[curBit ? 1 : 0], x, limit, cnt);
    }

    class Trie {
        Trie[] children = new Trie[2];
        int cnt = 1;
    }
}

