public class Solution {
    public int longestBeautifulSubstring(String word) {
        char[] chars = word.toCharArray();
        int maxLen = 0;
        int left = 0, right = 1;

        while (right < chars.length) {
            if (chars[right] > chars[right - 1]) {
                right++;
