import java.util.PriorityQueue;

public class Solution {
    public int[] assignTasks(int[] servers, int[] tasks) {
        PriorityQueue<Server> available = new PriorityQueue<>((a, b) -> a.weight == b.weight ? a.index - b.index : a.weight - b.weight);
        PriorityQueue<Server> busy = new PriorityQueue<>((a, b) -> a.availableTime == b.availableTime ? a.index - b.index : a.availableTime - b.availableTime);

        for (int i = 0; i < servers.length; i++) {
            available.offer(new Server(servers[i], i));
        }

        int[] ans = new int[tasks.length];
        for (int i = 0, time = 0; i < tasks.length; i++, time++) {
            while (!busy.isEmpty() && busy.peek().availableTime <= time) {
                available.offer(busy.poll());
            }
            if (available.isEmpty()) {
                Server server = busy.poll();
                time = server.availableTime;
                available.offer(server);
            }

            Server server = available.poll();
            ans[i] = server.index;
            server.availableTime = time + tasks[i];
            busy.offer(server);
        }
        return ans;
    }

    private static class Server {
        int weight, index, availableTime;

        public Server(int weight, int index) {
            this.weight = weight;
            this.index = index;
