public class Solution {
    public int largestMagicSquare(int[][] grid) {
        int m = grid.length, n = grid[0].length;

        // cumulative sum for each row
        int[][] rowSum = new int[m][n + 1];
        for (int i = 0; i < m; i++) {
            for (int j = 1; j <= n; j++) {
                rowSum[i][j] = rowSum[i][j - 1] + grid[i][j - 1];
            }
        }

        // cumulative sum for each column
        int[][] colSum = new int[n][m + 1];
        for (int i = 0; i < n; i++) {
            for (int j = 1; j <= m; j++) {
                colSum[i][j] = colSum[i][j - 1] + grid[j - 1][i];
            }
        }

        // start with the biggest side possible
        int maxSide = Math.min(m, n);
        for (int side = maxSide; side > 0; side--) {
            // check every square
            for (int i = 0; i <= m - side; i++) {
                for (int j = 0; j <= n - side; j++) {
                    if (isMagic(grid, rowSum, colSum, i, j, side)) {
                        return side;
                    }
                }
            }
        }

        // not found
        return 1;
    }

    private boolean isMagic(int[][] grid, int[][] rowSum, int[][] colSum, int x, int y, int side) {
        // check each row and column
        int target = rowSum[x][y + side] - rowSum[x][y];
        for (int i = 0; i < side; i++) {
            if (rowSum[x + i][y + side] - rowSum[x + i][y] != target) return false;
            if (colSum[y + i][x + side] - colSum[y + i][x] != target) return false;
        }

        // checks both diagonals
        int diagonal1 = 0, diagonal2 = 0;
        for (int i = 0; i < side; i++) {
            diagonal1 += grid[x + i][y + i];
            diagonal2 += grid[x + i][y + side - i - 1];
        }
        return diagonal1 == target && diagonal2 == target;
    }
}

