public class Solution {
    private static final int MOD = (int) 1e9 + 7;

    public int maxNiceDivisors(int primeFactors) {
        if (primeFactors == 1) return 1;

        if ((primeFactors & 1) == 0) {
            long res = 1;
            for (int i = 0; i < primeFactors / 2; ++i)
                res = res * 3 % MOD;
            return (int) res;
        }

        int[] dp = new int[primeFactors + 1];
        Arrays.fill(dp, -1);
        return dfs(primeFactors, dp);
    }

    private int dfs(int primeFactors, int[] dp) {
        if (dp[primeFactors] != -1)
            return dp[primeFactors];

        if (primeFactors == 0)
            return 1;

        if (primeFactors == 2)
            return 2;

        if (primeFactors == 3)
            return 4;

        int res = dfs(primeFactors - 2, dp) * 3 % MOD;
        res = (res + dfs(primeFactors - 4, dp) * 4 % MOD) % MOD;
        dp[primeFactors] = res;
        return res;
    }
}

