public class Solution {
    public int maximumRemovals(String s, String p, int[] removable) {
        int left = 0;
        int right = removable.length - 1;

        while (left <= right) {
            int mid = left + (right - left) / 2;

            // remove letters from 0 to mid by changing it into some other non letters
            char[] tempS = s.toCharArray();
            for (int i = 0; i <= mid; i++) {
                tempS[removable[i]] = '#';
            }

            if (isSubsequence(tempS, p)) {
                // if it is still subsequence change left boundary
                left = mid + 1;
            } else {
                // else replace all removed ones and change right boundary
                right = mid - 1;
            }
        }

        return left;
    }

    private boolean isSubsequence(char[] s, String p) {
        int idxS = 0;
        int idxP = 0;

        while (idxS < s.length && idxP < p.length()) {
            if (s[idxS] == p.charAt(idxP)) {
                idxP++;
            }
            idxS++;
        }

        return idxP == p.length();
    }
}

