public class Solution {
    public int[] getMaximumXor(int[] nums, int maximumBit) {
        int n = nums.length;
        int[] answer = new int[n];
        int xorSum = 0;

        // Calculate prefix XOR sum
        for (int num : nums) {
            xorSum ^= num;
        }

        // Calculate the maximum possible value with 'maximumBit' bits
        int maxVal = (1 << maximumBit) - 1;

        // Iterate over the array from end to start
        for (int i = n - 1; i >= 0; i--) {
            // XOR the current prefix sum with the maximum possible value
            answer[i] = xorSum ^ maxVal;

            // Update the prefix sum by removing the last element
            if (i > 0) {
                xorSum ^= nums[i];
            }
        }

        return answer;
    }
}

