    private boolean dfs(List<Integer>[] graph, String colors, int[][] dp, boolean[] visited, int node) {
        if (visited[node]) return false;

        visited[node] = true;
        for (int nei : graph[node]) {
            if (!dfs(graph, colors, dp, visited, nei)) return false;
            for (int i = 0; i < 26; i++) {
                dp[node][i] = Math.max(dp[node][i], dp[nei][i]);
            }
        }

        dp[node][colors.charAt(node) - 'a']++;
        return true;
    }
