public class Solution {
    public int shortestPathAllKeys(String[] grid) {
        char[][] g = new char[grid.length][];
        for (int i = 0; i < grid.length; i++) {
            g[i] = grid[i].toCharArray();
        }

        int m = g.length, n = g[0].length;
        int sx = -1, sy = -1, allKeys = 0;
        for (int i = 0; i < m; i++) {
            for (int j = 0; j < n; j++) {
                if (g[i][j] == '@') {
                    sx = i;
                    sy = j;
                } else if (Character.isLowerCase(g[i][j])) {
                    allKeys |= 1 << (g[i][j] - 'a');
                }
            }
        }

        Queue<int[]> q = new LinkedList<>();
        boolean[][][] visited = new boolean[m][n][64];
        q.offer(new int[]{sx, sy, 0});
        visited[sx][sy][0] = true;
        int step = 0;

        while (!q.isEmpty()) {
            for (int i = q.size(); i > 0; i--) {
                int[] cur = q.poll();
                if ((cur[2] & allKeys) == allKeys) return step;

                int[][] dirs = {{-1, 0}, {1, 0}, {0, -1}, {0, 1}};
                for (int[] dir : dirs) {
                    int nx = cur[0] + dir[0], ny = cur[1] + dir[1];
                    if (nx < 0 || nx >= m || ny < 0 || ny >= n || g[nx][ny] == '#') continue;

                    int newState = cur[2];
                    if (Character.isLowerCase(g[nx][ny])) {
                        newState |= 1 << (g[nx][ny] - 'a');
                    } else if (Character.isUpperCase(g[nx][ny]) && ((newState >> (g[nx][ny] - 'A')) & 1) == 0) {
                        continue;
                    }

                    if (!visited[nx][ny][newState]) {
                        visited[nx][ny][newState] = true;
                        q.offer(new int[]{nx, ny, newState});
                    }
                }
            }
            step++;
        }

        return -1;
    }
}

