                int nextSpeed = cur[1] * 2;
                if (nextPos >= 0 && !visited[nextPos][Math.abs(nextSpeed)]) {
                    queue.offer(new int[] {nextPos, nextSpeed});
                    visited[nextPos][Math.abs(nextSpeed)] = true;
                }

                // reverse
                nextSpeed = cur[1] > 0 ? -1 : 1;
                if (!visited[cur[0]][Math.abs(nextSpeed)]) {
                    queue.offer(new int[] {cur[0], nextSpeed});
                    visited[cur[0]][Math.abs(nextSpeed)] = true;
                }
            }
            step++;
        }

        return -1; // should not reach here
    }
}

