import com_github_leetcode.TreeNode;
import java.util.HashMap;
import java.util.Map;

// #Medium #Array #Hash_Table #Tree #Binary_Tree #Divide_and_Conquer
// #2022_03_28_Time_1_ms_(91.04%)_Space_43.3_MB_(78.11%)
public class Solution {
    public TreeNode constructFromPrePost(int[] preorder, int[] postorder) {
        Map<Integer, Integer> map = new HashMap<>();
        for (int i = 0; i < postorder.length; i++) {
            map.put(postorder[i], i);
        }

        return build(preorder, 0, preorder.length - 1, postorder, 0, postorder.length - 1, map);
    }

    private TreeNode build(int[] preorder, int preStart, int preEnd, int[] postorder, int postStart, int postEnd, Map<Integer, Integer> map) {
        if (preStart > preEnd || postStart > postEnd) return null;

        TreeNode root = new TreeNode(preorder[preStart]);
        if (preStart == preEnd) return root;

        int leftSubRootIndexInPostOrder = map.get(preorder[preStart + 1]);

        int leftSubTreeSize = leftSubRootIndexInPostOrder - postStart + 1;

        root.left = build(preorder, preStart + 1, preStart + leftSubTreeSize, 
                          postorder, postStart, leftSubRootIndexInPostOrder, map);

        root.right = build(preorder, preStart + leftSubTreeSize + 1, preEnd,
                           postorder, leftSubRootIndexInPostOrder + 1, postEnd - 1, map);

        return root;
    }
}

