import java.util.Arrays;
import java.util.Collections;
import java.util.List;

public class Solution extends Master {
    public void findSecretWord(String[] wordlist, Master master) {
        List<String> words = Arrays.asList(wordlist);
        Collections.shuffle(words);

        for (int i = 0; i < 10; i++) {
            String guess = words.get(0);
            int match = master.guess(guess);
            if (match == 6) return;

            List<String> nextWords = new ArrayList<>();
            for (String word : words.subList(1, words.size())) {
                if (matchWord(word, guess) == match) {
                    nextWords.add(word);
                }
            }

            words.clear();
            words.addAll(nextWords);
        }
    }

    private int matchWord(String a, String b) {
        int count = 0;
        for (int i = 0; i < 6; i++) {
            if (a.charAt(i) == b.charAt(i)) {
                count++;
            }
        }
        return count;
    }
}

