import java.util.ArrayDeque;
import java.util.ArrayList;
import java.util.Arrays;
import java.util.HashSet;
import java.util.List;
import java.util.Queue;
import java.util.Set;

public class Solution {
    public int numBusesToDestination(int[][] routes, int source, int target) {
        if (source == target) return 0;

        Set<Integer> busStops = new HashSet<>();
        for (int[] route : routes) {
            for (int stop : route) {
                busStops.add(stop);
            }
        }

        if (!busStops.contains(source) || !busStops.contains(target)) return -1;

        List<Set<Integer>> buses = new ArrayList<>();
        for (int i = 0; i < routes.length; i++) {
            Set<Integer> set = new HashSet<>();
            for (int stop : routes[i]) {
                set.add(stop);
            }
            buses.add(set);
        }

        Queue<int[]> queue = new ArrayDeque<>();
        Set<Integer> visitedStops = new HashSet<>();
        Set<Set<Integer>> visitedBuses = new HashSet<>();

        for (int i = 0; i < buses.size(); i++) {
            if (buses.get(i).contains(source)) {
                queue.offer(new int[] {i, 1});
                visitedBuses.add(buses.get(i));
            }
        }

        while (!queue.isEmpty()) {
            int[] current = queue.poll();
            Set<Integer> bus = buses.get(current[0]);

            for (int stop : bus) {
                if (stop == target) return current[1];

                for (int i = 0; i < buses.size(); i++) {
                    if (!visitedBuses.contains(buses.get(i)) && buses.get(i).contains(stop)) {
                        queue.offer(new int[] {i, current[1] + 1});
                        visitedBuses.add(buses.get(i));
                    }
                }

                visitedStops.add(stop);
            }
        }

        return -1;
    }
}

