// #Hard #Array #Sorting #Greedy #Heap_Priority_Queue
// #2022_03_27_Time_26_ms_(85.40%)_Space_42.6_MB_(95.75%)
import java.util.Arrays;
import java.util.Comparator;
import java.util.PriorityQueue;

public class Solution {
    public double mincostToHireWorkers(int[] quality, int[] wage, int k) {
        Worker[] workers = new Worker[quality.length];
        for (int i = 0; i < quality.length; i++) {
            workers[i] = new Worker(quality[i], wage[i]);
        }

        Arrays.sort(workers, Comparator.comparingDouble(o -> o.ratio));

        PriorityQueue<Integer> queue = new PriorityQueue<>((a, b) -> b - a);
        double res = Double.MAX_VALUE;
        int sum = 0;

        for (Worker worker : workers) {
            queue.add(worker.quality);
            sum += worker.quality;

            if (queue.size() > k) {
                sum -= queue.poll();
            }

            if (queue.size() == k) {
                res = Math.min(res, sum * worker.ratio);
            }
        }

        return res;
    }

    private static class Worker {
        int quality;
        double ratio;

        public Worker(int q, int w) {
            this.quality = q;
            this.ratio = (double) w / q;
        }
    }
}

