import java.util.Arrays;

public class Solution {
    public int sumSubseqWidths(int[] nums) {
        Arrays.sort(nums);
        long res = 0;
        final int MOD = (int)1e9 + 7;
        for (int i = 0; i < nums.length; i++) {
            res += ((long)(nums[i] * (pow(2, i) - pow(2, nums.length - 1 - i))) % MOD);
            res %= MOD;
        }
        return (int)res;
    }

    private long pow(long a, int b) {
        if (b == 0) return 1;
        long half = pow(a, b / 2);
        if (b % 2 == 0) return half * half % ((int)1e9 + 7);
        else return half * half % ((int)1e9 + 7) * a % ((int)1e9 + 7);
    }
}

