// #Hard #Heap_Priority_Queue #Graph #Shortest_Path
// #2022_03_28_Time_28_ms_(95.85%)_Space_66.3_MB_(87.56%)
public class Solution {
    public int reachableNodes(int[][] edges, int maxMoves, int n) {
        List<int[]>[] graph = new ArrayList[n];
        for (int i = 0; i < n; i++) {
            graph[i] = new ArrayList<>();
        }

        for (int[] edge : edges) {
            int u = edge[0], v = edge[1], w = edge[2];
            graph[u].add(new int[]{v, w + 1});
            graph[v].add(new int[]{u, w + 1});
        }

        PriorityQueue<int[]> pq = new PriorityQueue<>((a, b) -> a[1] - b[1]);
        boolean[] visited = new boolean[n];
        pq.offer(new int[]{0, 0});

        int res = 0;
        while (!pq.isEmpty()) {
            int[] cur = pq.poll();
            if (visited[cur[0]]) continue;
            visited[cur[0]] = true;
            res++;

            for (int[] next : graph[cur[0]]) {
                if (next[1] > maxMoves - cur[1]) continue;
                res += Math.min(next[1], maxMoves - cur[1]);
                pq.offer(new int[]{next[0], cur[1] + 1});
            }
        }

        return res;
    }
}
